import React from "react";
import CreateAccount from "./macroComponents/createAccount";
class register extends Component {
  state = {};
  render() {
    return (
      <React.Fragment>
        <Route
          exact
          path="/register/createAccount"
          render={(props) => (
            <CreateAccount
              submitEmail={(email) => this.getEmail(email)}
              {...props}
            />
          )}
        />
      </React.Fragment>
    );
  }
}

export default register;
